Következő funkciók:

```java
public class Fibonacci {

    public static double[] fibonacci(int n) {
        if (n == 0) {
            return new double[0];
        } else if (n == 1) {
            return new double[]{1};
        } else if (n == 2) {
            return new double[]{1, 1};
        }

        double[] result = new double[n];
        for(int i=0; i<n; i++) {
            result[i] = fibonacci(i+1) + fibonacci(i-2);
        }

        return result;
    }
}
```

